import React, { useReducer } from 'react'

const reducer = (state, action) => {
 
}


const Reducer = () => {

    const [state, dispatch] = useReducer(reducer, { })




    return (
        <div>
            < input
                className='inp_css'
                onChange={(e) => dispatch({ type: 'handle_inp', load_email: e.target.value })}
                value={state.email}
                type="email" />
            < input
                className='inp_css'
                onChange={(e) => dispatch({ type: 'handle_inp', load_pwd: e.target.value })}
                value={state.pwd}
                type="password" />
            <h2> {state.email} </h2>
            <h2> {state.pwd} </h2>

        </div>
    )
}

export default Reducer
